import React from "react";
import FavouritesList from "./FavouritesList.js";
import PlayFilters from "./PlayFilters.js";
import PlayMatches from "./PlayMatches.js";

const PlayList = (props) => {
    return (
        <div className="container">
            <FavouritesList favourites={props.favourites} deleteFromFavourites={props.deleteFromFavourites}/>
            <PlayFilters updateFilters={props.updateFilters}/>
            <PlayMatches addToFavourites={props.addToFavourites}/>
        </div>
    );
};

export default PlayList
